import React from "react";

const SOCIALS = [
  {
    name: "Linkedin",
    link: "https://www.linkedin.com/in/noah-farinas-b3b9571b0/",
    icon: "logo-linkedin",
  },
  {
    name: "Instagram",
    link: "https://www.instagram.com/noahhnigel/?hl=en",
    icon: "logo-instagram",
  },
  {
    name: "Github",
    link: "https://github.com/noahfarinas",
    icon: "logo-github",
  },
];
const NAV = [
  {
    name: '"HOME"',
  },
  {
    name: '"ABOUT ME"',
  },
  {
    name: '"PROJECTS"',
  },
  {
    name: '"CONTACT"',
  },
];

const Navbar = () => {
  const handleClick = (event) => {
    const elementId = event.target.textContent.toLowerCase().replace(/"/g, '');
    const element = document.getElementById(elementId);
    element.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <header>
      <div className="navbar">
        <div className="name">
          <img src="./photos/jordan.GIF" alt="shoes" />
          <div className="navbarMenu">
            {NAV.map((item) => (
              <h3 onClick={handleClick}>{item.name}</h3>
            ))}
          </div>
        </div>
        <div className="links">
          {SOCIALS.map((item) => (
            <a href={item.link} target="_blank">
              <ion-icon name={item.icon}></ion-icon>

            </a>
          ))}
        </div>
      </div>
    </header>
  );
};

export default Navbar;
